                    String name = ((SQLIdentifierExpr) left).getName();
                    if ("rownum".equals(name)) {
                        print(1);
                        return;
                    }
                }
            }
        }
    }

    if (parameterized) {
        print('?');
        incrementReplaceCount();

        if (this.parameters != null) {
            ExportParameterVisitorUtils.exportParameter(this.parameters, x);
        }
        return;
    }

    if (val.signum() == -1) {
        BigInteger maxUnsignedValue = BigInteger.ONE.shiftLeft(64).subtract(BigInteger.ONE);
        val = val.add(maxUnsignedValue);
    }

    print(val);
}

